import './Map.css';
import { MapContainer} from 'react-leaflet';
import Layers from './Layers/Layers';
import Legend from './Legend/Legend';



function Map() {

  return (
    <div className="Map">
      <MapContainer center={[52.52437, 13.41053]} zoom={13}>
        <Layers />
        <Legend />
      </MapContainer>
    </div>
  );
}

export default Map;
